import React, {useState} from "react";
import projects from "./projects.json";

const Projects = () => {

    return <>
		<h2>Projects</h2>
        {
            projects.map((project, index) => (
                <div key={index}>
                    <h4>{project.name}</h4>
					<small>{project.Language}</small>
					<ul>
						{project.description.forEach(item => <li>{item}</li>)}
					</ul>



                </div>
            ))
        }
    </>
}

export default Projects
